import React from "react";
import { withRouter } from "react-router-dom";
import {
  Container,
  Card,
  CardContent,
  Typography,
  withStyles,
  TextField,
  Grid,
  Button,
  Hidden,
  // Link
} from "@material-ui/core";
import Autocomplete from "@material-ui/lab/Autocomplete";
import ArrowRightIcon from "@material-ui/icons/ArrowRight";
import DialogComponent from "../../components/dialog/index";
import CheckCircleOutlineIcon from "@material-ui/icons/CheckCircleOutline";
import CheckboxLabels from "../../components/checkbox/index2";
import DateFnsUtils from "@date-io/date-fns";

import {
  MuiPickersUtilsProvider,
  KeyboardDatePicker,
} from "@material-ui/pickers";
import axios from "axios";
import moment from "moment";
import config from "../../config";
// style
const styles = (theme) => ({
  root: {
    width: "100%",
    background: theme.palette.mainbackground.default,
    opacity: 1,
    padding: "30px 0px",
  },
  title: {
    fontSize: 16,
    fontWeight: 600,
    // color: "#012834"
  },
  card: {
    background: theme.palette.background.paper,
    boxShadow: "0px 5px 10px #00000014",
    borderRadius: 16,
    opacity: 1,
    margin: "20px 0px",
  },
  card_title: {
    borderBottom: `2px solid ${theme.palette.mainbackground.default}`,
    fontWeight: "bold",
    fontSize: 14,
    [theme.breakpoints.only("xs")]: {
      height: "20px",
    },
  },
  clear: {
    boxShadow: "0px 3px 6px #0049903D",
    border: `1px solid #4BCD3E`,
    opacity: 0.9,
    fontSize: 12,
    borderRadius: 8,
    fontWeight: 600,
    marginLeft: 0,
    padding: "7px 16px",
    marginTop: "15px",
    width: "100px",
    [theme.breakpoints.only("xs")]: {
      width: "95px",
      marginLeft: 0,
      marginTop: "0px",
    },
    [theme.breakpoints.only("sm")]: {
      width: "95px",
      marginLeft: 0,
      marginTop: "0px",
    },
  },

  clear112: {
    boxShadow: "0px 3px 6px #0049903D",
    border: `1px solid #4BCD3E`,
    opacity: 0.9,
    fontSize: 12,
    borderRadius: 8,
    fontWeight: 600,
    marginLeft: 22,
    padding: "10px 16px",
    marginBottom: "0px",
    marginTop: "30px",

    [theme.breakpoints.only("md")]: {
      width: "200px",
      marginLeft: 0,
      marginTop: "30px",
    },
  },

  clear1: {
    boxShadow: "0px 3px 6px #0049903D",
    border: `1px solid #4BCD3E`,
    opacity: 0.9,
    fontSize: 12,
    borderRadius: 8,
    fontWeight: 600,
    marginLeft: 22,
    padding: "10px 16px",
    marginBottom: "0px",
    marginTop: "30px",

    [theme.breakpoints.only("xs")]: {
      width: "95px",
      marginLeft: 0,
      marginTop: "20px",
    },
    [theme.breakpoints.only("sm")]: {
      width: "95px",
      marginLeft: 0,
      marginTop: "0px",
    },
    [theme.breakpoints.only("md")]: {
      width: "95px",
      marginLeft: 0,
      marginTop: "30px",
    },
  },
  text_title: {
    padding: "6px 0px",
    opacity: 0.9,
  },
  body: {
    padding: "30px 0px",
  },
  btns: {
    margin: "20px 0px",
  },

  submit: {
    border: `2px solid ${theme.palette.primary.main}`,
    background: theme.palette.primary.main,
    boxShadow: "0px 3px 6px #0049903D",
    borderRadius: 8,
    fontSize: 12,
    opacity: 0.9,
    marginRight: 12,
    "&:hover": {
      background: theme.palette.primary.main,
    },
  },
  d_icon: {
    margin: "auto",
    width: "100%",
    cursor: "pointer",
    textAlign: "center",
    color: theme.palette.primary.main,
    fontSize: 50,
  },
  d_title: {
    fontSize: 16,
    fontWeight: 600,
    textAlign: "center",
    color: theme.palette.secondary.main,
    opacity: 0.8,
    letterSpacing: 1,
    paddingBottom: "12px",
  },
  submit1: {
    marginTop: "35px",
    background: "#4BCD3E",
    boxShadow: "0px 3px 6px #0049903D",
    borderRadius: 8,
    fontSize: 12,
    opacity: 0.9,
    marginLeft: "20px",
    color: "#2A2A2A",
    [theme.breakpoints.only("xs")]: {
      marginLeft: "0px",
      marginTop: "0px !important",
      marginRight: "20px",
    },
  },
  submitbotton: {
    [theme.breakpoints.only("xs")]: {
      marginRight: "0px !important",
    },
    [theme.breakpoints.only("sm")]: {
      marginRight: "0px !important",
    },
  },
  d_btn: {
    textAlign: "center",
    margin: "auto",
    display: "flex",
    height: "40px",
    color: theme.palette.secondary.contrastText,
    fontSize: 16,
    textTransform: "capitalize",
    fontWeight: 600,
    boxShadow: "0px 10px 15px #70707028",
    background: theme.palette.primary.main,
    transition: "0.5s",
    "& button": {
      padding: 8,
    },
    "&:hover": {
      transition: "0.5s",
      background: theme.palette.primary.main,
      boxShadow: "0px 10px 15px #70707028",
      opacity: 0.9,
    },
  },

  otpbox: {
    marginLeft: "18px",
    [theme.breakpoints.only("md")]: {
      marginTop: "-8px",
      position: "relative",
    },
    [theme.breakpoints.only("xs")]: {
      marginTop: "0px",
      marginLeft: "0px",
      padding: "0px",
    },
  },
  enterOTP12: {
    position: "relative",
    left: "46px",

    [theme.breakpoints.only("sm")]: {
      left: "0px",
      position: "relative",
    },
  },
  input: {
    width: "100%",
  },
  otpdd: {
    [theme.breakpoints.only("md")]: {
      left: "30px",
      position: "relative",
    },
  },
  buttons: {
    marginTop: "30px",
    [theme.breakpoints.only("md")]: {
      marginTop: "35px",
    },
    [theme.breakpoints.only("xs")]: {
      marginTop: "0px",
      marginLeft: "0px",
    },
    [theme.breakpoints.only("sm")]: {
      marginTop: "-25px",
      marginLeft: "0px",
    },
  },
  profile: {
    borderBottom: `3px solid ${theme.palette.primary.main}`,
    background: theme.palette.background.paper,
    boxShadow: "0px 5px 10px #00000014",
    borderRadius: 8,
    width: "50%",
    margin: "auto",
    textAlign: "center",
    height: "50px",
    alignItems: "center",
    display: "flex",
    justifyContent: "center",
    fontWeight: 600,
    fontSize: 15,
    opacity: 0.8,
    [theme.breakpoints.only("xs")]: {
      width: "97%",
      height: "auto",
      padding: 6,
    },
  },
  hint_title2: {
    textAlign: "end",
    color: "#4BCD3E",
    marginTop: "0px",
    [theme.breakpoints.down("xs")]: {
      marginLeft: "0px",
      textAlign: "left",
      marginTop: "0px !important",
    },
    [theme.breakpoints.down("sm")]: {
      marginTop: "-50px",
      position: "relative",
      right: "40px",
    },
    [theme.breakpoints.down("md")]: {
      position: "relative",
      marginLeft: "0px",
      marginTop: "0px !important",
    },
  },
  phn: {
    color: theme.palette.primary.main,
    marginRight: 8,
    marginLeft: 6,
    [theme.breakpoints.only("xs")]: {
      marginTop: -12,
    },
  },
});
// end
const valData = {
  F: { value: "Female", label: "F" },
  M: { value: "Male", label: "M" },
}
const marriedStatusd = {
  S: { value: "Single", label: "S" },
  M: { value: "Married", label: "M" },
};
class MyaccountEditComponent extends React.Component {
  // state
  constructor(props) {
    super(props);
    this.state = {
      submit: false,
      open: false,
      firstName: "",
      lastName: null,
      usertype: null,
      userId: null,
      activationDate: new Date(),
      expirationDate: new Date(),
      addressLine1: null,
      addressLine2: null,
      city: null,
      statevalue: null,
      pincode: null,
      country: null,
      phoneNumber: null,
      countrycode: "+91",
      areacode: "",
      officeNumber: null,
      emailId: "",
      workAddRLine1: "",
      workAddRLine2: "",
      workCity: "",
      statevalue1: "",
      workPostCode: "",
      workCountry: "",
      mothername: "",
      homeCountry: "",
      homePostCode: "",
      homeCity: "",
      middleName: "",
      mobilenum: "",
      otpdsiabled: true,
      isValidate: true,
      isUpdate: true
    };
  }
  // end

  handleClears = async () => {
    debugger
    await axios
      .post(`${config.api_url}api/v1/users/modifyDetails`, {
        approverId: "",
        checkerId: "",
        custUpdateReq: [{
          reqId: "",
          actionCode: "E",
          custCode: "",
          title: "",
          accNo: this.state.accNo ?? "",
          firstName: this.state.firstName ?? "",
          lastName: this.state.lastName ?? "",
          dateOfBirth: this.state.expirationDate ?? "",
          gender: this.state.gender?.label ?? "",
          married: this.state.married?.label ?? "",
          emailId: this.state.emailId ?? "",
          addressLine0: this.state.addressLine0 ?? "",
          addressLine1: this.state.addressLine1 ?? "",
          addressLine2: this.state.addressLine2 ?? "",
          addressLine3: this.state.addressLine3 ?? "",
          homeCity: this.state.homeCity ?? "",
          homeCountry: this.state.homeCountry ?? "",
          homeCountryCode: this.state.homeCountryCode ?? "",
          homeTel: this.state.homeTel ?? "",
          homePostCode: this.state.homePostCode ?? "",
          pobox: this.state.pobox ?? "",
          workAddRLine1: this.state.workAddRLine1 ?? "",
          workAddRLine2: this.state.workAddRLine2 ?? "",
          workAddRLine3: this.state.workAddRLine3 ?? "",
          workCity: this.state.workCity ?? "",
          workCountry: this.state.workCountry ?? "",
          workCountryCode: this.state.workCountryCode ?? "",
          workTel: this.state.workTel ?? "",
          workPostCode: this.state.workPostCode ?? "",
          idNumber: this.state.idNumber ?? "",
          nationalId: this.state.nationalId ?? "",
          mobNo: this.state.phoneNumber ?? "",
          mothername: this.state.mothername ?? "",
          middleName: this.state.middleName ?? "",
          kycTypeId: "1",
        }],
        flag: "S",
        makerId: "",
        remarks: "",
      })
      .then((res) => {
        if (res.data) {
          const data = res.data;
          this.setState({
            ...data,
          });
        }
      })
      .catch((err) => {
        console.log("Profile details", err);
      });
  }
  handleOtps = async () => {
    const body = {
      cardNumber: "",
      cbsCardNum: "",
      cbsErrorMsg: "",
      cbsMobNum: "",
      channelId: "",
      code: "",
      institutionId: "",
      mobileNumber: "",
      otac: "",
      otp: "",
      otpId: "",
    };
    await this.apiFetchEdit("api/v1/otp/generate", body, "otp");
    // await this.apiFetchEdit("api/v1/otp/generate", body, "resendotp");
  };

  handleClear = () => {
    debugger
    axios
      .post(`${config.api_url}api/v1/otp/generate`, {
        "cardNumber": '',
        "channelId": "SMS",
        "institutionId": '',
      })
      .then((res) => {
        if (res.data) {
          const data = res.data;
          this.setState({
            ...data,
            OTPNumber: data?.otp ?? "",
            otpdsiabled: false,
            isValidate: false
          });
        }
      })
      .catch((err) => {
        console.log("Profile details", err);
      });
  }

  handlevalidation = () => {
    axios
      .post(`${config.api_url}api/v1/otp/validate`, {
        institutionId: "",
        cardno: "",
        mobilenum: this.state.mobnumber ? this.state.mobnumber : "",
        // otac: "",
        otp: this.state.OTPNumber ? this.state.OTPNumber : "",
        otpId: this.state.otpId ?? '',
        refId: "",
        referenceNumber: "",
      })
      .then((res) => {
        if (res.data) {
          const data = res.data;
          this.setState({
            ...data,
            isUpdate: false,
            OTPNumber: this.state.OTPNumber ? this.state.OTPNumber : ""
          });
        }
      })
      .catch((err) => {
        console.log("Profile details", err);
      });
  }

  componentDidMount() {
    debugger
    // the fetch api
    this.handleClears();
  }
  handleChange = (n, v) => {
    const state = this.state;
    this.setState({
      ...state,
      [n]: v,
    });
  };
  // handle submit funcy
  // handlesubmit = () => {
  //     const state = this.state;
  //     this.setState({ ...state, submit: true, open: true })
  //     setTimeout(() => {
  //         this.setState({ submit: false });
  //         this.props.history.push("/home")
  //     }, 3000);
  // }
  // end
  render() {
    const { classes } = this.props;

    const {
      open,
      submit,
      firstName,
      lastName,
      usertype,
      mothername,
      userId,
      expirationDate,
      addressLine1,
      addressLine2,
      homeCity,
      homePostCode,
      city,
      statevalue,
      workAddRLine1,
      workAddRLine2,
      homeCountry,
      workCity,
      statevalue1,
      workPostCode,
      workCountry,
      pincode,
      country,
      phoneNumber,
      areacode,
      countrycode,
      officeNumber,
      emailId,
      middleName,
      mobilenum
    } = this.state;

    return (
      <div className={classes.root}>
        <Container>
          {/* dialogbox component */}
          {submit && (
            <DialogComponent
              open={open}
              handleClose={this.handleClose}
              component={
                <div>
                  <CheckCircleOutlineIcon className={classes.d_icon} />
                  <Typography variant="subtitle2" className={classes.d_title}>
                    {" "}
                    User profile has been successfully modified.{" "}
                  </Typography>
                  <Button
                    variant="contained"
                    color="primary"
                    disableElevation
                    className={classes.d_btn}
                    onClick={() => this.props.history.push("/home")}
                  >
                    Ok
                  </Button>
                </div>
              }
            />
          )}
          {/* end */}

          {/* Breadcrumbs component */}

          {/* end */}

          {/* card component one*/}
          <Card className={classes.card} variant="outlined">
            <CardContent className={classes.card_title}>
              Cardholder Details
            </CardContent>
            <CardContent className={classes.card_title}>Personal</CardContent>

            <Container>
              <div className={classes.body}>
                <Grid container spacing={2}>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      First Name
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="First Name"
                      className={classes.input}
                      onChange={(e) =>
                        this.handleChange("firstName", e.target.value)
                      }

                      value={firstName}
                    />
                  </Grid>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Middle Name
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="Middle Name"
                      onChange={(e) =>
                        this.handleChange("middleName", e.target.value)
                      }

                      value={middleName}
                      className={classes.input}
                    />
                  </Grid>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Last Name
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="Last Name"
                      value={lastName}
                      onChange={(e) =>
                        this.handleChange("lastName", e.target.value)
                      }

                      className={classes.input}
                    />
                  </Grid>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Father/Husband's Name
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="Father Name"
                      onChange={(e) =>
                        this.handleChange("userId", e.target.value)
                      }

                      value={userId}
                      className={classes.input}
                    />
                  </Grid>

                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Mother's Maiden Name
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="Mother Name"
                      value={mothername}
                      onChange={(e) =>
                        this.handleChange("mothername", e.target.value)
                      }

                      className={classes.input}
                    />
                  </Grid>

                  <Grid item container xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Martial status
                    </Typography>
                    <Autocomplete
                      fullWidth={false}
                      size="small"
                      style={{ width: "100%" }}
                      value={this.state.married}
                      name="reson"
                      options={[{ value: "Married", label: "M" }, { value: "Single", label: "S" }]}
                      getOptionLabel={(option) => option.value}
                      onChange={(e, v) => this.handleChange("married", v)}
                      renderInput={(params) => (
                        <TextField
                          {...params}
                          // helperText={
                          //   props.error?.mCountry &&
                          //   "Please enter your country Code"
                          // }
                          // error={props.error?.mCountry}
                          variant="outlined"
                          placeholder=""
                          className={classes.TextField}
                        />
                      )}
                    />
                  </Grid>

                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Gender
                    </Typography>
                    <Autocomplete
                      fullWidth={false}
                      size="small"
                      style={{ width: "100%" }}
                      value={this.state.gender}
                      name="reson"
                      options={[{ value: "Male", label: "M" }, { value: "Female", label: "F" }]}
                      getOptionLabel={(option) => option.value}
                      onChange={(e, v) => this.handleChange("gender", v)}
                      renderInput={(params) => (
                        <TextField
                          {...params}
                          // helperText={
                          //   props.error?.mCountry &&
                          //   "Please enter your country Code"
                          // }
                          // error={props.error?.mCountry}
                          variant="outlined"
                          placeholder=""
                          className={classes.TextField}
                        />
                      )}
                    />
                  </Grid>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Email ID
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="Email ID"

                      value={emailId?.toLowerCase()}
                      onChange={(e) =>
                        this.handleChange("email", e.target.value)
                      }
                      className={classes.input}
                    />
                  </Grid>
                  <Grid item container xs={12} sm={6} spacing={2}>
                    <Grid item xs={6}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        Mobile Number
                      </Typography>
                      <Grid
                        item
                        container
                        xs={12}
                        sm={12}
                        spacing={0}
                        style={{ justifyContent: "space-between" }}
                      >
                        <Grid item xs={12} sm={3}>
                          <TextField
                            type="text"
                            size="small"
                            variant="outlined"
                            placeholder="country Code"

                            value={countrycode}
                            onChange={(e) =>
                              this.handleChange("countrycode", e.target.value)
                            }
                            className={classes.input}
                          />
                        </Grid>
                        <Grid item xs={12} sm={8}>
                          <TextField
                            type="text"
                            size="small"
                            variant="outlined"
                            placeholder="Mobile Number"

                            value={phoneNumber}
                            onChange={(e) =>
                              this.handleChange("phoneNumber", e.target.value)
                            }
                            className={classes.input}
                          />
                        </Grid>
                      </Grid>
                    </Grid>

                    <Grid item xs={6}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        Office Number
                      </Typography>
                      <Grid
                        item
                        container
                        xs={12}
                        sm={12}
                        style={{ justifyContent: "space-between" }}
                      >
                        <Grid item xs={12} sm={3}>
                          <TextField
                            type="text"
                            size="small"
                            variant="outlined"
                            placeholder="Area Code"

                            value={areacode}
                            onChange={(e) =>
                              this.handleChange("areacode", e.target.value)
                            }
                            className={classes.input}
                          />
                        </Grid>
                        <Grid item xs={12} sm={8}>
                          <TextField
                            type="text"
                            size="small"
                            variant="outlined"
                            placeholder="Office Number"

                            value={officeNumber}
                            onChange={(e) =>
                              this.handleChange("officeNumber", e.target.value)
                            }
                            className={classes.input}
                          />
                        </Grid>
                      </Grid>
                    </Grid>
                  </Grid>
                  <Grid item xs={12} sm={6} style={{ marginLeft: "14px" }}>
                    <MuiPickersUtilsProvider utils={DateFnsUtils}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        {" "}
                        Date of Birth
                      </Typography>
                      <KeyboardDatePicker

                        style={{ width: "100%", margin: 0 }}
                        inputVariant="outlined"
                        margin="normal"
                        format="MM/dd/yyyy"
                        value={expirationDate}
                        onChange={(date) =>
                          this.handleChange("expirationDate", date)
                        }
                        KeyboardButtonProps={{
                          "aria-label": "change date",
                        }}
                        size="small"
                      />
                    </MuiPickersUtilsProvider>
                  </Grid>
                </Grid>

                <div>
                  <CardContent className={classes.card_title}>
                    Mailing Address
                  </CardContent>
                </div>
                <Grid container spacing={2} style={{ marginTop: "20px" }}>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Address Line 1
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="Address Line 1"

                      value={addressLine1}
                      onChange={(e) =>
                        this.handleChange("addressLine1", e.target.value)
                      }
                      className={classes.input}
                    />
                  </Grid>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Address Line 2
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="Address Line 2"

                      value={addressLine2}
                      onChange={(e) =>
                        this.handleChange("addressLine2", e.target.value)
                      }
                      className={classes.input}
                    />
                  </Grid>
                  <Grid item xs={12} sm={3}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      City
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="City"

                      value={homeCity}
                      onChange={(e) =>
                        this.handleChange("homeCity", e.target.value)
                      }
                      className={classes.input}
                    />
                  </Grid>
                  <Grid item xs={12} sm={3}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      State
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="State"

                      value={statevalue}
                      onChange={(e) =>
                        this.handleChange("statevalue", e.target.value)
                      }
                      className={classes.input}
                    />
                  </Grid>
                  <Grid item xs={12} sm={3}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      PIN Code
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="PIN Code"

                      value={homePostCode}
                      onChange={(e) =>
                        this.handleChange("homePostCode", e.target.value)
                      }
                      className={classes.input}
                    />
                  </Grid>
                  <Grid item xs={12} sm={3}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Country
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="Country"

                      value={homeCountry}
                      onChange={(e) =>
                        this.handleChange("homeCountry", e.target.value)
                      }
                      className={classes.input}
                    />
                  </Grid>

                  <div>
                    <CardContent className={classes.card_title}>
                      Permanent Address
                    </CardContent>{" "}
                    <CheckboxLabels style={{ marginTop: "100px" }} />
                  </div>

                  <Grid container spacing={2} style={{ marginTop: "0px" }}>
                    <Grid item xs={12} sm={6}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        Address Line 1
                      </Typography>
                      <TextField
                        type="text"
                        size="small"
                        variant="outlined"
                        placeholder="Address Line 1"

                        value={workAddRLine1}
                        onChange={(e) =>
                          this.handleChange("workAddRLine1", e.target.value)
                        }
                        className={classes.input}
                      />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        Address Line 2
                      </Typography>
                      <TextField
                        type="text"
                        size="small"
                        variant="outlined"
                        placeholder="Address Line 2"

                        value={workAddRLine2}
                        onChange={(e) =>
                          this.handleChange("workAddRLine2", e.target.value)
                        }
                        className={classes.input}
                      />
                    </Grid>
                    <Grid item xs={12} sm={3}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        City
                      </Typography>
                      <TextField
                        type="text"
                        size="small"
                        variant="outlined"
                        placeholder="City"

                        value={workCity}
                        onChange={(e) =>
                          this.handleChange("workCity", e.target.value)
                        }
                        className={classes.input}
                      />
                    </Grid>
                    <Grid item xs={12} sm={3}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        State
                      </Typography>
                      <TextField
                        type="text"
                        size="small"
                        variant="outlined"
                        placeholder="State"

                        value={statevalue1}
                        onChange={(e) =>
                          this.handleChange("statevalue", e.target.value)
                        }
                        className={classes.input}
                      />
                    </Grid>
                    <Grid item xs={12} sm={3}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        PIN Code
                      </Typography>
                      <TextField
                        type="text"
                        size="small"
                        variant="outlined"
                        placeholder="PIN Code"

                        value={workPostCode}
                        onChange={(e) =>
                          this.handleChange("workPostCode", e.target.value)
                        }
                        className={classes.input}
                      />
                    </Grid>
                    <Grid item xs={12} sm={3}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        Country
                      </Typography>
                      <TextField
                        type="text"
                        size="small"
                        variant="outlined"
                        placeholder="Country"

                        value={workCountry}
                        onChange={(e) =>
                          this.handleChange("workCountry", e.target.value)
                        }
                        className={classes.input}
                      />
                    </Grid>
                  </Grid>
                </Grid>

                <Grid item xs={12} sm={12} style={{ textAlign: "end" }}>
                  <Button
                    className={classes.clear112}
                    onClick={() => this.handleClears()}
                    disabled={this.state.isUpdate}
                  >
                    Update Information
                  </Button>
                </Grid>

                <Grid container spacing={4} style={{ marginTop: "10px" }}>
                  <Grid item container xs={12} sm={6} spacing={4}>
                    <Grid item xs={12} sm={12} md={10} lg={10}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        Enter registered mobile number
                      </Typography>
                      <TextField
                        type="number"
                        size="small"
                        variant="outlined"
                        placeholder="Mobile Number"
                        value={mobilenum}
                        onChange={(e) => this.handleChange("mobilenum", e.target.value)}
                        className={classes.input}
                      />
                    </Grid>
                    <Grid
                      item
                      xs={12}
                      sm={12}
                      md={2}
                      lg={2}
                      className={classes.buttons}
                    >
                      <Button
                        style={{ width: "80px" }}
                        className={classes.clear}
                        onClick={() => this.handleClear()}
                      >
                        Send OTP
                      </Button>
                    </Grid>
                  </Grid>
                  <Grid
                    item
                    container
                    xs={12}
                    sm={6}
                    spacing={2}
                    className={classes.otpbox}
                  >
                    <Grid
                      item
                      xs={12}
                      sm={12}
                      md={10}
                      lg={9}
                      className={classes.enterOTP}
                    >
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        Enter OTP Number
                      </Typography>
                      <TextField
                        type="number"
                        size="small"
                        variant="outlined"
                        style={{ width: "100%" }}
                        placeholder="OTP Number"
                        className={classes.input}
                        disabled={this.state.otpdsiabled}
                        onChange={(e) => {
                          this.handleChange("OTPNumber", e.target.value);
                        }}
                        value={this.state.OTPNumber}
                      />
                    </Grid>

                    <Grid
                      item
                      xs={12}
                      sm={12}
                      md={2}
                      lg={3}
                      className={classes.enterOTP1}
                    >
                      <Button
                        className={classes.clear1}
                        onClick={() => this.handlevalidation()}
                        disabled={this.state.isValidate}
                      >
                        validate
                      </Button>
                    </Grid>

                    <Grid
                      item
                      xs={12}
                      sm={12}
                      className={classes.otpdd}
                      style={{ paddingTop: "0px" }}
                    >
                      <Hidden xsUp>Enter OTP Number</Hidden>
                    </Grid>
                    <Grid
                      item
                      xs={12}
                      sm={6}
                      className={classes.enterOTP12}
                      style={{ paddingTop: "0px" }}
                    >
                      <Typography
                        variant="subtitle2"
                        className={classes.hint_title2}
                        onClick={() => this.handleClear()}
                      >
                        Resend OTP
                        <ArrowRightIcon
                          style={{ position: "relative", top: "7px" }}
                        />
                      </Typography>
                    </Grid>
                  </Grid>
                </Grid>
              </div>
            </Container>
          </Card>
          {/* end */}

          {/* PhoneInTalkIcon section */}

          {/* end */}
        </Container>
      </div>
    );
  }
}

export default withStyles(styles)(withRouter(MyaccountEditComponent));
